import React, { FC } from "react";
import { Button } from "@chakra-ui/react";
import { BrowserRouter, Routes, Route } from 'react-router-dom';

const App: FC = () => {
  return (
    <BrowserRouter>
      <Routes>
        //path는 가장 처음에 보이는 주소
        <Route path="/" element={<Main />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
